CREATE TABLE `usuarios` (
  `gus_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `gus_gpe_id` bigint(20) DEFAULT NULL,
  `gus_imagen` varchar(200) DEFAULT NULL,
  `gus_gro_id` bigint(20) NOT NULL,
